INSERT INTO `chinacourt_fygg` VALUES ('1', '北京天泰鑫源商贸有限公司及公司股东', '北京市密云区人民法院', '2016-06-03', '二版', '北京天泰鑫源商贸有限公司及公司股东：\\n北京市密云区人民法院根据北京金环房地产开发有限公司的申请，于2016年5月25日裁定受理对你单位进行强制清算的申请。因你单位下落不明，本院决定向你单位公告送达本院（2016）京0118民算2号民事裁定书，自公告之日起经过60日即视为送达。并于2016年8月23日上午9时在北京市密云区人民法院第十八法庭召开第一次债权人会议。本案由法官于立华任审判长，与法官王化雨、张俊杰组成合议庭，书记员郑伟担任法庭记录。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4668526.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('2', '北京银科丰业投资顾问有限公司', '北京市第一中级人民法院', '2016-05-28', '三版', '本院根据北京银科丰业投资顾问有限公司的申请于2016年1月15日作出（2016）京01民破2号民事裁定，受理华孚科技有限公司破产清算一案，并于2016年3月18日指定北京京诚会计师事务所有限责任公司为华孚科技有限公司管理人。华孚科技有限公司的债权人应在2016年7月28日前，向华孚科技有限公司管理人（通讯地址：北京市西城区德外大街乙10号9层；邮政编码：100011；联系电话：62368582、62223308）申报债权。如未能在前述期限内申报债权，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照法律规定的程序行使权利。华孚科技有限公司的债务人或者财产持有人应尽快向华孚科技有限公司管理人清偿债务或交付财产。本院定于2016年7月28日下午14时在北京市第一中级人民法院第三审判区第二十三法庭召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书，委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。', 'http://www.live.chinacourt.org/fygg/display/id/4646350.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('3', '北京市七翔实业公司', '北京市朝阳区人民法院', '2016-05-09', '七版', '2015年5月21日，本院根据北京市七翔实业公司的申请裁定受理北京市七翔实业公司破产清算一案，查明，经过管理人核查和京诚会审字（2015）1043号清算审计报告的记载，北京市七翔实业公司资产总额为128.27元，负债总额为3245655.49元，北京市七翔实业公司的财产严重不足以清偿破产费用。本院认为，北京市七翔实业公司的财产不足以清偿破产费用，而且无人代为清偿或予以垫付，北京市七翔实业公司管理人向本院申请宣告北京市七翔实业公司破产，并终结破产程序，符合法律规定，应当予以准许。依照法律规定，本院于2015年12月25日作出（2015）朝民（商）破字第08616-2号裁定书，宣告北京市七翔实业公司破产并终结北京市七翔实业公司破产清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4610288.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('4', '北京东华恒盛造纸技术发展有限公司', '北京市东城区人民法院', '2016-05-07', '二版', '2015年9月30日，本院根据北京东华恒盛造纸技术发展有限公司的申请裁定受理北京东华恒盛造纸技术发展有限公司破产清算一案。查明北京东华恒盛造纸技术发展有限公司账面资产总额为47034.3元，在债权申报期间申报的债权共为1040430.48元，上述债权亦经第一次债权人会议通过并由本院依法确认。本院认为，经审查，北京东华恒盛造纸技术发展有限公司不能清偿到期债务，且其资产不足以清偿全部债务。故依照法律规定，本院于2016年4月11日裁定宣告北京东华恒盛造纸技术发展有限公司破产。', 'http://www.live.chinacourt.org/fygg/display/id/4599804.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('5', '北京华安伟业科贸有限公司', '北京市丰台区人民法院', '2016-04-30', '二版', '本院根据北京华安伟业科贸有限公司的申请于2016年3月14日裁定受理北京华安伟业科贸有限公司破产清算一案，并已指定毕马威华振会计师事务所（特殊普通合伙）为北京华安伟业科贸有限公司破产管理人。北京华安伟业科贸有限公司的债权人应自公告之日起三个月内，向北京华安伟业科贸有限公司破产管理人（通讯地址：北京市东城区东长安街东方广场毕马威大楼8层；邮编：100738；联系电话：010-85085918）申报债权。未在上述期限内申报债权的，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已经进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国企业破产法》规定的程序行使权利。北京华安伟业科贸有限公司的债务人或财产持有人应当向北京华安伟业科贸有限公司管理人清偿债务或交付财产。本院定于债权申报期限届满之日起第十五日上午9时在本院第三十七法庭（地点：北京市丰台区近园路9号五层）召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明。特此公告。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4590580.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('6', '北京中海建设工程有限公司成都分公司', '四川省眉山市中级人民法院', '2016-04-23', '二版', '本院根据北京中海建设工程有限公司成都分公司的申请裁定2016年2月27日受理眉山金象化工产业园区开发服务有限公司破产清算一案，并于2016年3月2日指定四川山助律师事务所为眉山金象化工产业园区开发服务有限公司管理人。眉山金象化工产业园区开发服务有限公司的债权人应于2016年7月15日前，向眉山金象化工产业园区开发服务有限公司管理人[通信地址：四川省眉山市彭山区凤鸣镇南街60号（四川山助律师事务所办公室）；邮政编码：620860；联系人：王勇；联系电话：02837621557、13547683075]申报债权。未在上述期限内申报债权的，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照法律规定的程序行使权利。眉山金象化工产业园区开发服务有限公司的债务人或者财产持有人应当向眉山金象化工产业园区开发服务有限公司管理人清偿债务或交付财产。本院定于2016年7月28日上午9时30分在四川省眉山市东坡区杭州路88号（管理人四川山助律师事务所办公场所）召开第一次债权人会议，依法申报债权的债权人有权参加债权人会议。参加会议的债权人系自然人的，应提交个人身份证明；系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件，委托代理人是律师的还应提交律师执业证、律师事务所的指派函。', 'http://www.live.chinacourt.org/fygg/display/id/4553037.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('7', '北京汤尼路易服饰有限公司', '北京市朝阳区人民法院', '2016-04-20', '七版', '本院根据温州市枫迪服饰有限公司的申请2016年3月3日裁定受理北京汤尼路易服饰有限公司破产清算一案，并指定北京市企业清算事务所有限公司为北京汤尼路易服饰有限公司管理人。北京汤尼路易服饰有限公司的债权人应自公告之日起四十五日内，向北京汤尼路易服饰有限公司管理人（通信地址：北京市海淀区四季青路8号郦城工作区422室；邮政编码：100195；联系电话：88498923转805）申报债权。未在上述期限内申报债权的，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照法律规定的程序行使权利。北京汤尼路易服饰有限公司的债务人或者财产持有人应当向北京汤尼路易服饰有限公司管理人清偿债务或交付财产。本院定于2016年6月20日下午14时在北京市朝阳区人民法院民事审判第四庭（北京市朝阳区华威北里甲14号）召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。', 'http://www.live.chinacourt.org/fygg/display/id/4575824.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('8', '北京神泉食品机械开发公司', '北京市海淀区人民法院', '2016-04-17', '三版', '北京神泉食品机械开发公司：\\n我院根据河北信投集团资产管理有限公司的申请，裁定受理对你单位进行破产清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海民破（预）字第00018号民事裁定书，自公告之日起经过60日即视为送达。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4557015.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('9', '北京民海艳科技有限公司', '北京市海淀区人民法院', '2016-04-17', '三版', '北京民海艳科技有限公司：\\n我院根据合肥水泥研究设计院的申请，裁定受理对你单位进行破产清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海民破（预）字第00020号民事裁定书，自公告之日起经过60日即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4550638.shtml', '2016-06-13 15:42:51');
INSERT INTO `chinacourt_fygg` VALUES ('10', '北京北齿宏源商贸公司', '北京市朝阳区人民法院', '2016-04-14', '二版', '2015年5月21日，本院根据北京北齿宏源商贸公司的申请裁定受理北京北齿宏源商贸公司破产清算一案。查明，经过管理人核查和华会查字[2015]B061号清算审计报告记载，北京北齿宏源商贸公司资产总额为111.92元，负债总额为19003294.5元，北京北齿宏源商贸公司的财产严重不足以清偿破产费用。本院认为，北京北齿宏源商贸公司的财产不足以清偿破产费用，而且无人代为清偿或予以垫付，北京北齿宏源商贸公司管理人向本院申请宣告北京北齿宏源商贸公司破产，并终结破产程序，符合法律规定，应当予以准许。依照法律规定，本院于2015年12月25日作出（2015）朝民（商）破字第08615-2号裁定宣告北京北齿宏源商贸公司破产并终结北京北齿宏源商贸公司破产清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4543337.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('11', '北京亚洲电视城有限公司', '北京市第一中级人民法院', '2016-04-13', '二版', '本院根据北京农村商业银行股份有限公司军博支行的申请于2016年3月15日裁定受理北京亚洲电视城有限公司破产清算一案，并于同日指定北京市忠慧律师事务所为北京亚洲电视城有限公司管理人。北京亚洲电视城有限公司的债权人应自公告之日起30日内，向北京亚洲电视城有限公司管理人（通讯地址：北京市海淀区中关村西区丹棱街18号创富大厦9层901；邮政编码：100080；联系电话：01082605518，13811364685）申报债权。逾期申报者，可以在破产财产最后分配前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。北京亚洲电视城有限公司的债务人或者财产持有人应尽快向北京亚洲电视城有限公司管理人清偿债务或交付财产。第一次债权人会议将于2016年6月16日下午13时30分在本院第三审判区第二中法庭召开，请各债权人准时参加。出席会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。债权人系自然人的，应提交个人身份证明。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。', 'http://www.live.chinacourt.org/fygg/display/id/4543341.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('12', '北京京城重工桥箱机械有限公司', '北京市通州区人民法院', '2016-04-06', '三版', '2015年3月25日，本院根据申请人北京京城重工桥箱机械有限公司强制清算组的申请裁定受理北京京城重工桥箱机械有限公司（以下简称京城桥箱公司）破产清算一案。经本院审查，截止2014年12月31日京城桥箱公司资产总计29614054.79元，负债总额31974504.47元，所有者权益-2360449.68元，并长期拖欠职工工资和税款，多项债务无法进行清偿。本院认为京城桥箱公司已经严重资不抵债，已达到法定破产条件，应当宣告被申请人北京京城重工桥箱机械有限公司破产。依照法律规定，本院于2015年11月18日作出（2015）通破初字第7987-2号民事裁定，宣告被申请人北京京城重工桥箱机械有限公司破产。', 'http://www.live.chinacourt.org/fygg/display/id/4528083.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('13', '北京新正元科技投资管理有限公司', '北京市第一中级人民法院', '2016-04-01', '六版', '本院根据济南泉永印务有限公司的申请于2016年3月11日裁定受理北京新正元科技投资管理有限公司破产清算一案，并于2016年3月11日指定北京市中洲律师事务所为北京新正元科技投资管理有限公司管理人。北京新正元科技投资管理有限公司的债权人应自2016年6月2日前，向北京新正元科技投资管理有限公司管理人（通讯地址：北京市海淀区知春路甲48号盈都大厦C座三单元11层；邮政编码：100098；联系电话：51266607/18511748199）申报债权。未在上述期限内申报债权的，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照法律规定的程序行使权利。北京新正元科技投资管理有限公司的债务人或者财产持有人应当向北京新正元科技投资管理有限公司管理人清偿债务或交付财产。本院定于2016年6月2日上午9时在北京市第一中级人民法院第三审判区第二十三法庭召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。', 'http://www.live.chinacourt.org/fygg/display/id/4528076.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('14', '北京世都餐饮有限公司', '北京市海淀区人民法院', '2016-04-01', '八版', '北京世都餐饮有限公司：\\n我院根据陈旭等人的申请，裁定受理对你单位进行破产清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海民破（预）字第00021号民事裁定书，自公告之日起经过60日即视为送达。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4527336.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('15', '北京宏明顺达商贸有限公司', '北京市丰台区人民法院', '2016-03-24', '三版', '本院根据傅靖的申请于2014年12月4日裁定受理北京宏明顺达商贸有限公司（以下简称宏明顺达公司）申请公司清算一案，本院查明，2015年5月11日、2016年2月19日，宏明顺达公司分别召开债权人会议和股东会议、清算组会议，会议审核并表决通过了《北京宏明顺达商贸有限公司财产分配方案》（经本院裁定予以确认）。宏明顺达公司清算组经调查发现该公司因公司财务资料缺失，不能进行全面清算，现清算组已按法定程序完成公司财产的分配。根据法律规定，宏明顺达公司清算组申请终结清算程序，符合法律规定，本院予以准许。清算程序终结后，宏明顺达公司债权人可以另行依据有关规定，要求该公司股东、董事、实际控制人等清算义务人对其债务承担偿还责任。股东可以向控股股东等实际控制公司的主体主张有关权利。依照法律规定，裁定终结北京宏明顺达商贸有限公司的清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4493513.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('16', '北京搏展通达科技发展有限公司', '北京市海淀区人民法院', '2016-03-16', '六版', '北京搏展通达科技发展有限公司：我院根据成都腾威教育咨询集团有限公司的申请，裁定受理对你单位进行破产清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海民破（预）字第00019号民事裁定书，自公告之日起经过60日即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4488637.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('17', '北京迅壹达贸易有限公司、浙江易士企业管理服务有限公司', '杭州市上城区人民法院', '2016-02-05', '八版', '本院根据债权人北京迅壹达贸易有限公司的申请，已于2015年12月29日作出（2015）杭上破字第1-1民事裁定书，宣告债务人浙江易士企业管理服务有限公司破产还债。债权人应在公告之日3个月内，向本院书面申报债权，说明债权数额和有无财产担保，并提交有关证明材料。逾期未申报债权的，视为自动放弃债权。第一次债权人会议定于2016年5月11日09时在本院本院第十六号法庭召开。望债权人准时参加。', 'http://www.live.chinacourt.org/fygg/display/id/4422737.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('18', '北京泛达科工贸集团、中国南方航空股份有限公司湖南分公司及河南分公司、南航（集团）汕头航空有限公司及贵州航空有限公司、南航（集团）广西航空有限公司、中国东方航空公司山西分公司及云南分公司、山东航空股份有限公司、橡武运输部、柳耐保温材料厂', '广西非法院单位', '2016-02-03', '六版', '北京泛达科工贸集团、中国南方航空股份有限公司湖南分公司及河南分公司、南航（集团）汕头航空有限公司及贵州航空有限公司、南航（集团）广西航空有限公司、中国东方航空公司山西分公司及云南分公司、山东航空股份有限公司、橡武运输部、柳耐保温材料厂：桂林蓝宇航空轮胎翻新有限公司清算组经桂林市中级人民法院同意，决定对该公司财产拍卖并清偿债务后，剩余财产由北京股东北京泛达科工贸集团公司与桂林股东按出资比例取回，请北京泛达科工贸集团于公告之日起十日内领取，逾期清算组将向有关部门提存。翻新公司可能存在的债权和技术资产，由北京泛达科工贸集团和桂林股东按出资比例共有。其中技术资产包括原股东作为出资的全部轮胎翻新技术。共享的债权包括：中国南方航空股份有限公司海南分公司33元；中国南方航空股份有限公司湖南分公司13030元；中国南方航空股份有限公司河南分公司69670元；南航（集团）汕头航空有限公司64410元；南航（集团）贵州航空有限公司112400元；南航（集团）广西航空有限公司4670元；中国东方航空公司山西分公司153957.8元；中国东方航空公司云南分公司62143元；东航空股份有限公司51169元；橡武运输部46000元；柳耐保温材料厂10万元；刘长63883元。请前述债务人将原欠桂林蓝宇航空轮胎翻新有限公司的前述债务向北京泛达科工贸集团和化学工业部桂林蓝宇航空轮胎发展公司按照3:1的比例清偿。桂林蓝宇航空轮胎翻新有限公司清算组', 'http://www.live.chinacourt.org/fygg/display/id/4427498.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('19', '杨中市塑性材料厂、北京市绿田园生态农场公司、沈阳气体压缩机厂、长城资产管理公司哈尔滨办事处、哈市洪江锅炉安装有限责任公司、哈市第四建筑工程公司第五分公司、哈五星玻璃钢有限公司、哈新哈水电设备制造有限公司、黑龙江省北方建筑安装公司、哈尔滨双新环保工程股份有限公司、鞍山自控仪表（集团）股份公司、哈市应用技术研究所有限公司、上海新奥分子筛有限公司、哈市北光工程技术开发有限公司、哈尔滨联通机床配件公司、中国石油兰州石油化工公司仪表厂、沈阳电机股份有限公司、西林集团阿城钢铁有限公司、沈阳透平机械股份有限公司、哈市南岗区地方税务局、哈尔滨富康房地产开发股份公司、哈市电控仪器厂、哈尔滨市洪化锅炉水质服务站', '黑龙江省哈尔滨市中级人民法院', '2016-02-01', '三版', '杨中市塑性材料厂、北京市绿田园生态农场公司、沈阳气体压缩机厂、长城资产管理公司哈尔滨办事处、哈市洪江锅炉安装有限责任公司、哈市第四建筑工程公司第五分公司、哈五星玻璃钢有限公司、哈新哈水电设备制造有限公司、黑龙江省北方建筑安装公司、哈尔滨双新环保工程股份有限公司、鞍山自控仪表（集团）股份公司、哈市应用技术研究所有限公司、上海新奥分子筛有限公司、哈市北光工程技术开发有限公司、哈尔滨联通机床配件公司、中国石油兰州石油化工公司仪表厂、沈阳电机股份有限公司、西林集团阿城钢铁有限公司、沈阳透平机械股份有限公司、哈市南岗区地方税务局、哈尔滨富康房地产开发股份公司、哈市电控仪器厂、哈尔滨市洪化锅炉水质服务站：2014年3月5日，哈尔滨制氧机厂破产清算组向本院提出申请，请求本院依法裁定。本院认为，哈尔滨制氧机厂破产清算组制定的《哈尔滨制氧机厂破产财产分配方案》符合《中华人民共和国企业破产法》第一百一十三条第一款破产财产清算程序的规定，作出（2006）哈破字第10-1号裁定，对哈尔滨制氧机厂破产清算组制定的《哈尔滨制氧机厂破产财产分配方案》予以认可。债权额占无财产担保的债权总额二分之一以上的债权人如不服本裁定，可在本裁定书送达之日起十五日内，向本院申请复议，复议期间不停止裁定的执行。', 'http://www.live.chinacourt.org/fygg/display/id/4418112.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('20', '北京宽石量投科技有限责任公司', '北京市海淀区人民法院', '2016-01-24', '六版', '2014年6月16日，本院根据杨晓静的申请裁定受理北京宽石量投科技有限责任公司破产清算一案。经查明本院认为北京宽石量投科技有限责任公司不能清偿到期债务，无人对该公司提出重整或和解申请，该公司资产尚不足以清偿破产费用，且无人代为清偿或予以垫付，已具备宣告破产并终结破产程序的条件。本院依照《中华人民共和国企业破产法》第四十三条第四款、第一百零七条第一款之规定，于2015年12月25日裁定宣告北京宽石量投科技有限责任公司破产并终结北京宽石量投科技有限责任公司破产程序。', 'http://www.live.chinacourt.org/fygg/display/id/4400505.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('21', '湖北京大饲料股份有限公司', '沙洋县人民法院', '2016-01-22', '七版', '根据武汉兴牧贸易有限公司、李大红等人的申请，本院于2016年1月15日受理了湖北京大饲料股份有限公司的破产清算一案，并指定该公司清算小组为破产管理人。湖北京大饲料股份有限公司的债权人应在2016年3月19日前向湖北京大饲料股份有限公司破产管理人（通讯地址：湖北省沙洋县拾桥镇汉宜路4、5、6幢办公楼202室 ；邮政编码：448270 ；联系人：刘居银 手机号码13707267228）申报债权。未在上述期限申报债权的，可以在破产财产最后分配前补充申报，但对此前已经进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国企业破产法》规定的程序行使权利。第一次债权人会议定于2016年3月 26日 9时在本院第一审判庭（地址：湖北省沙洋县平湖路33号）召开，参加债权人会议时提交身份证复印件（或法定代表人身份证明书），有委托代理人的，提交授权委托书。', 'http://www.live.chinacourt.org/fygg/display/id/4407240.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('22', '北京首钢吉泰安合金材料有限公司', '北京市第一中级人民法院', '2016-01-16', '七版', '本院根据北京首钢吉泰安合金材料有限公司的申请于2015年12月30日裁定受理该公司破产清算一案，并于2015年12月30日指定北京首钢吉泰安合金材料有限公司清算组为北京首钢吉泰安合金材料有限公司管理人。北京首钢吉泰安合金材料有限公司的债权人应自2016年3月7日前，向北京首钢吉泰安合金材料有限公司管理人（通讯地址：北京市海淀区四季青路8号郦城工作区422室；邮政编码：100195；联系电话：88498283-807；88498283-808）申报债权。未在上述期限内申报债权的，可以在破产财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国企业破产法》规定的程序行使权利。北京首钢吉泰安合金材料有限公司的债务人或者财产持有人应当向北京首钢吉泰安合金材料有限公司管理人清偿债务或交付财产。本院定于2016年3月22日9时30分在本院第三审判区第25法庭召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。', 'http://www.live.chinacourt.org/fygg/display/id/4396819.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('23', '北京古虎数码娱乐科技有限公司及其法定代表人', '北京市石景山区人民法院', '2015-12-30', '六版', '北京古虎数码娱乐科技有限公司及其法定代表人：本院受理申请人北京腾信创新网络营销技术股份有限公司申请北京古虎数码娱乐科技有限公司强制清算一案，经审理本院裁定：终结被申请人北京古虎数码娱乐科技有限公司的强制清算程序。现依法向你送达（2013）石法特清算初字第00003-2号民事裁定书（终结）。自公告之日起60日内来本院领取民事裁定书（终结），逾期即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4351459.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('24', '北京古虎数码娱乐科技有限公司', '北京市石景山区人民法院', '2015-12-30', '六版', '本院根据北京腾信创新网络营销技术股份有限公司申请，裁定受理北京古虎数码娱乐科技有限公司强制清算一案。并指定北京市康达律师事务所作为本强制清算案的清算组。由于北京古虎数码娱乐科技有限公司人员、账册、重要文件等清算依据均下落不明，清算组至今未接管其任何财务账册，故清算组无法对其进行全面清算。依法清算组的申请，本院于2015年12月17日裁定终结北京古虎数码娱乐科技有限公司强制清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4351468.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('25', '北京西金房地产开发有限公司', '北京市密云区人民法院', '2015-12-27', '六版', '北京西金房地产开发有限公司：本院受理北京市糕点食品工业公司申请你公司破产清算一案，本院于2015年12月11日裁定受理北京市糕点食品工业公司对你公司的破产清算申请。现依法向你公司公告送达（2015）密破预初字第1-1号民事裁定书。自公告之日起60日内来本院领取民事裁定书，逾期视为送达。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4348033.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('26', '北京美洁华延商业有限公司', '北京市东城区人民法院', '2015-12-15', '三版', '北京市东城区人民法院于2015年5月12日裁定受理了申请人北京联合华延商业中心提出的对被申请人北京美洁华延商业有限公司进行强制清算一案，并指定北京市隆安律师事务所为清算组。北京美洁华延商业有限公司的债权人应自接到清算组发出的申报通知书之日起三十日内，未接到通知书的自本公告发布之日起四十五日内，向清算组北京市隆安律师事务所（通讯地址：北京市朝阳区建国门外大街21号北京国际俱乐部188室。邮编：100020。联系人：高光。电话：010-65325588，18611773338，传真：010-65323768）申报债权。债权人申报债权时，应当说明债权的性质、数额、形成原因等，并提供证明材料；债权人系自然人的，应提交个人身份证明；债权人系法人或其他组织的，应提交法人营业执照、法定代表人身份证明；委托代理人还应提交特别授权委托书、委托代理人的身份证件等文件。北京美洁华延商业有限公司的债务人或者财产持有人应向北京美洁华延商业有限公司清算组清偿债务或者交付财产。北京美洁华延商业有限公司的法定代表人、股东及有关管理人员应自公告之日起十日内向清算组移交北京美洁华延商业有限公司财产、印章、财务、账簿和重要文件，并配合清算组工作。如因上述财产和文件的灭失导致北京美洁华延商业有限公司无法清算的，公司股东将对公司债务承担连带清偿责任。', 'http://www.live.chinacourt.org/fygg/display/id/4323602.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('27', '北京大市投资有限公司', '北京非法院单位', '2015-12-15', '三版', '根据2015年11月12日北京市第一中级人民法院民事裁定书（（2009）一中民破字第10110号），驳回北京北方银通房地产开发有限公司、北京环球世纪投资管理有限公司以北京大市投资有限公司不能清偿其到期债务的破产清算申请。现特就有关事项公告如下：因北京大市投资有限公司未向破产管理人提交任何资料，故破产管理人无资料移交，2015年11月22日裁定书已生效，北京大市投资有限公司破产管理人工作已结束。2015年11月22日裁定书生效后，北京大市投资有限公司的一切法律责任与破产管理人无关。北京大市投资有限公司破产管理人 2015年12月1日', 'http://www.live.chinacourt.org/fygg/display/id/4321736.shtml', '2016-06-13 15:42:52');
INSERT INTO `chinacourt_fygg` VALUES ('28', '北京华源仁济医药有限公司', '北京市密云区人民法院', '2016-06-09', '八版', '北京华源仁济医药有限公司：\\n北京密云经济开发区总公司申请你公司强制清算一案，本院已立案。因你公司处于解散状态，本院依法向你公司公告送达强制清算申请书、证据材料、应诉通知书、合议庭组成人员通知书及召开听证会传票。自本公告发出之日起经过60日即视为送达。提出答辩状期限为公告期满后的15日内，你公司应当自公告期满之日起30日内向本院提交证据，在举证期限内不提交的，视为放弃举证权利。本院定于举证期满后第3日上午9时（遇法定节假日顺延）在本院第18法庭召开听证会，逾期将缺席召开。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4687544.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('29', '北京天泰鑫源商贸有限公司的债权人', '北京市密云区人民法院', '2016-06-04', '二版', '北京天泰鑫源商贸有限公司的债权人：\\n本院根据北京金环房地产开发有限公司的申请，于2016年5月25日作出（2016）京0118民算2号民事裁定书，裁定受理北京天泰鑫源商贸有限公司强制清算申请。并于2016年5月25日指定天职国际会计师事务所(特殊普通合伙)担任北京天泰鑫源商贸有限公司清算组。债权人应自公告之日起45日内，向北京天泰鑫源商贸有限公司清算组申报债权（通信地址：北京市海淀区车公庄西路19号68号楼A-1和A-5区域；邮政编码：100048；联系人袁芳，手机号码 185 0081 6236），并提交有关证明材料。未在上述期限内申报债权的，可以在清算财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。北京天泰鑫源商贸有限公司的债务人或者财产持有人应当向北京天泰鑫源商贸有限公司清算组清偿债务或交付财产。\\n本院定于2016年8月23日上午9时在北京市密云区人民法院第十八法庭召开第一次债权人会议。依法申报债权的债权人有权参加债权人会议。参加会议的债权人系法人或其他组织的，应提交营业执照、法定代表人或负责人身份证明书，如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。参加会议的债权人系自然人的，应提交个人身份证明。如委托代理人出席会议，应提交特别授权委托书、委托代理人的身份证件或律师执业证，委托代理人是律师的还应提交律师事务所的指派函。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4668532.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('30', '北京恒溪房地产开发有限公司', '北京市第二中级人民法院', '2016-05-26', '八版', '北京恒溪房地产开发有限公司：\\n    申请人北京市城市改建综合开发总公司因你公司被北京市工商行政管理局吊销营业执照后未按法律规定期限成立清算组自行清算，故向本院申请指定清算组对你公司进行强制清算。你公司如对申请人北京市城市改建综合开发总公司提出的强制清算申请有异议，应当自收到本通知之日起7日内向本院书面提出，逾期不提出的，不影响本案的审理。\\n    特此通知。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4657250.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('31', '北京图汇联合科技有限公司', '北京市通州区人民法院', '2016-05-26', '八版', '2015年9月1日，本院裁定立案受理申请人天津三基金属有限公司对被申请人北京图汇联合科技有限公司强制清算一案。后本院指定北京市正见永申律师事务所组成北京图汇联合科技有限公司清算组。北京图汇联合科技有限公司的债权人应自公告之日起四十五日内，向清算组北京市正见永申律师事务所（通讯地址：北京市朝阳区朝外大街12号昆泰大厦2606室，邮政编码：10020，联系人：蔡慧，电话：010-58790066，13720032459）申报债权。债权人申报债权，应当说明债权的有关事项，并提供证明材料。清算组应当对债权进行登记。在申报债权期间，清算组不得对债权人进行清偿。公司清算时，债权人对清算组核定的债权有异议的，可以要求清算组重新核定。清算组不予重新核定，或者债权人对重新核定的债权仍有异议，债权人有权以公司为被告向人民法院提起诉讼请求确认。', 'http://www.live.chinacourt.org/fygg/display/id/4631760.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('32', '北京龙聚点文化发展有限公司', '北京市海淀区人民法院', '2016-05-23', '八版', '我院于2015年10月8日裁定受理北京龙聚点文化发展有限公司强制清算一案，于2016年4月18日指定北京市大地律师事务所组成清算组。北京龙聚点文化发展有限公司的债权人应自公告发布之日起30日内向清算组【通讯地址：北京市西城区华远北街2号通港大厦10层1080室；联系人及联系电话：魏洪君 13911563129、谭俊善13581550537】申报债权。未在上述期限内申报债权的，可以在清算财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国公司法》规定的程序行使权利。北京龙聚点文化发展有限公司的债务人或者财产持有人应当向北京龙聚点文化发展有限公司清算组清偿债务或交付财产。', 'http://www.live.chinacourt.org/fygg/display/id/4625530.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('33', '北京中纺物产发展有限公司', '北京市朝阳区人民法院', '2016-05-20', '二版', '本院根据申请人浙江华瑞集团有限公司的申请，裁定受理北京中纺物产发展有限公司申请公司清算一案，并指定北京市君合律师事务所为北京中纺物产发展有限公司清算组。北京中纺物产发展有限公司的债权人应自公告之日起四十五日内，向北京中纺物产发展有限公司清算组（通讯地址：北京市建国门北大街8号华润大厦20层；邮政编码：100005;联系电话：85191300）申报债权。未在上述期限内申报债权的，可以在清算财产分配完毕前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国公司法》规定的程序行使权利。北京中纺物产发展有限公司的债务人或者财产持有人应当向北京中纺物产发展有限公司清算组清偿债务或者交付财产。\\n法定代表人、财务管理人员以及其他经营管理人员、股东应妥善保管并移交其占有和管理的财产、印章和账簿、文书等资料。如因上述财产和文件灭失导致北京中纺物产发展有限公司无法清算的，股东及负有责任的实际控制人对公司债务承担连带责任。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4636219.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('34', '北京兴内发动机有限责任公司', '北京市大兴区人民法院', '2016-05-10', '三版', '北京兴内发动机有限责任公司：申请人北内集团总公司以你公司被北京市工商行政管理局大兴分局吊销营业执照后未按法律规定期限成立清算组自行清算为由向本院申请对你公司进行强制清算。本院于2015年9月21日裁定受理北内集团总公司的强制清算申请。现本院依法向你公司公告送达本院（2015）大法特清预初字第51号民事裁定书，裁定内容为：终结对被申请人北京兴内发动机有限责任公司的强制清算程序。自公告之日起60日内来本院领取民事裁定书，逾期则视为送达。本裁定送达后立即生效。', 'http://www.live.chinacourt.org/fygg/display/id/4609240.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('35', '北京开普思高教育科技有限公司', '北京市海淀区人民法院', '2016-05-07', '三版', '2013年9月30日，本院根据北京锦之虹航空服务有限公司的申请裁定受理北京开普思高教育科技有限公司强制清算一案。因北京开普思高教育科技有限公司仅有部分财产，不足以支付清算费用，无法全面清算。依照相关规定，本院于2016年4月18日裁定终结北京开普思高教育科技有限公司强制清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4592533.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('36', '北京双洋基业商贸有限公司以及该公司的股东余亚平、吕学翠', '北京市大兴区人民法院', '2016-05-04', '八版', '北京双洋基业商贸有限公司以及该公司的股东余亚平、吕学翠：北京资源亚太食品有限公司向本院申请对北京双洋基业商贸有限公司进行强制清算一案，我院于2016年4月6日作出（2016）京0115民算1号民事裁定书，裁定：终结对被申请人北京双洋基业商贸有限公司的清算程序。清算程序终结后，债权人北京资源亚太食品有限公司可以另行依据法律规定，要求被申请人北京双洋基业商贸有限公司的清算义务对其债务承担偿还责任。该裁定自作出之日起生效。自公告之日起，60日内来本院领取民事裁定书，逾期即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4595504.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('37', '北京毕保信投资有限公司', '北京非法院单位', '2016-04-29', '三版', '北京毕保信投资有限公司经北京市第三中级人民法院裁定，已进入强制清算程序，并指定了清算组。请该公司见公告后立即向清算组办理移交手续；请林建伟见公告后立即与清算组联系，配合清算；请债权人见公告后45日内向清算组申报债权。清算组地址，北京市西城区华远北街2号通港大厦10层1018室，联系人谭俊善，电话68091988；13581550537。北京毕保信投资有限公司清算组 2016年4月4日', 'http://www.live.chinacourt.org/fygg/display/id/4588158.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('38', '中农诺康（北京）生态农业科技有限公司', '北京市海淀区人民法院', '2016-04-29', '三版', '我院于2015年11月18日裁定受理中农诺康（北京）生态农业科技有限公司强制清算一案，于2016年3月28日指定北京市长安律师事务所组成清算组。中农诺康（北京）生态农业科技有限公司的债权人应自公告发布之日起30日内向清算组【通讯地址：北京市朝阳区甜水园街6号中国检验检疫大厦14层；邮政编码：100026；联系人及联系电话：王松18600091862】申报债权。未在上述期限内申报债权的，可以在清算财产分配方案提交债权人会议讨论前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照《中华人民共和国公司法》规定的程序行使权利。中农诺康（北京）生态农业科技有限公司的债务人或者财产持有人应当向中农诺康（北京）生态农业科技有限公司清算组清偿债务或交付财产。', 'http://www.live.chinacourt.org/fygg/display/id/4588700.shtml', '2016-06-13 15:43:26');
