INSERT INTO `chinacourt_fygg` VALUES ('40', '北京海川创智科技发展有限公司', '北京市海淀区人民法院', '2016-03-22', '七版', '北京海川创智科技发展有限公司：\\n我院根据海洋化工研究院有限公司的申请，裁定受理对你单位进行强制清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海民清（预）字第00022号民事裁定书，自公告之日起经过60日即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4506449.shtml', '2016-06-13 15:43:26');
INSERT INTO `chinacourt_fygg` VALUES ('41', '中宽网络科技（北京）有限公司', '北京市海淀区人民法院', '2016-03-16', '七版', '中宽网络科技（北京）有限公司：中国铁通集团有限公司北京分公司以你单位解散后15日内不成立清算组进行清算为由，向本院申请对你单位进行强制清算。因你单位下落不明，我院决定向你单位公告送达强制清算申请书，自公告之日起经过60日即视为送达。依据《北京市高级人民法院关于审理公司强制清算案件操作规范（试行）》第十一条之规定，你单位对该申请如有异议，应在公告送达期满之日起七日内向本院书面提出并附相关证据材料。', 'http://www.live.chinacourt.org/fygg/display/id/4490073.shtml', '2016-06-13 15:43:26');
