INSERT INTO `chinacourt_fygg` VALUES ('46', '中亚星火（北京）能源科技有限公司', '北京市海淀区人民法院', '2016-03-16', '七版', '中亚星火（北京）能源科技有限公司：我院根据李云鸿的申请，裁定受理对你单位进行强制清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海法特清（预）初字第00023号民事裁定书，自公告之日起经过60日即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4488598.shtml', '2016-06-13 15:43:27');
