INSERT INTO `chinacourt_fygg` VALUES ('50', '北京中百信数字技术有限公司', '北京市海淀区人民法院', '2016-03-16', '七版', '北京中百信数字技术有限公司：我院根据中关村高科技产业促进中心的申请，裁定受理对你单位进行强制清算的申请。因你单位下落不明，我院决定向你单位公告送达我院（2015）海民清（预）字第00019号民事裁定书，自公告之日起经过60日即视为送达。', 'http://www.live.chinacourt.org/fygg/display/id/4488623.shtml', '2016-06-13 15:43:27');
