INSERT INTO `chinacourt_fygg` VALUES ('52', '北京世纪奥威文化发展有限公司债权人', '北京市门头沟区人民法院', '2016-03-04', '七版', '北京市门头沟区人民法院 公告 \\n2014年门民清（算）字第3040号\\n2014年7月14日，本院裁定立案受理申请人北京市海淀区爱心天歌艺术培训学校对被申请人北京世纪奥威文化发展有限公司申请强制清算一案。2016年2月22日，本院指定北京市企业清算事务所成立北京世纪奥威文化发展有限公司清算组。债权人应当自接到通知书之日起三十日内，未接到通知书的公告之日起四十五日内，向清算组（清算组工作地址：北京市海淀区四季青路郦城工作区422室，联系人：骆建华，联系电话：88498283-806）申报其债权。债权人申报债权，应当说明债权的有关事项，并提供证明材料。清算组应当对债权进行登记。在申报债权期间，清算组不得对债权人进行清偿。公司清算时，债权人对清算组核定的债权有异议的，可以要求清算组重新核定。清算组不予重新核定，或者债权人对重新核定的债权仍有异议，债权人有权以公司为被告向人民法院提起诉讼请求确认。\\n特此公告。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4466032.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('53', '北京利乐拉伐食品机械有限公司', '北京非法院单位', '2016-02-26', '七版', '北京市尚荣信律师事务所根据（2014）二中法特清算初字第07446-1号决定书指定，组成北京利乐拉伐食品机械有限公司（以下简称利乐拉伐公司）清算组，现清算组公告如下：利乐拉伐公司债权人应自公告之日起90日内，向清算组（联系人：汪敏，地址：北京市朝阳区朝外大街20号联合大厦6层607室，电话01084195135，传真01084195130）申报债权，并提交有关证明材料。逾期未申报债权的，依据法律规定处理。利乐拉伐公司债务人或者财产持有人应向清算组清偿债务或者交付财产。第一次债权人会议于2016年6月8日（星期三）上午9时30分在北京市第二中级人民法院召开，地址北京市丰台区方庄路10号。债权人出席会议应向本院提交营业执照、个人或法定代表人身份证明、授权委托书。北京利乐拉伐食品机械有限公司清算组 2016年1月29日', 'http://www.live.chinacourt.org/fygg/display/id/4449002.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('54', '北京鸿安停车库制造有限公司的债权人', '北京市昌平区人民法院', '2016-01-14', '三版', '北京鸿安停车库制造有限公司的债权人：本院根据北京鸿安停车库制造有限公司股东中关村高科技产业促进中心的申请，于2015年8月19日作出（2015）昌法特清预初字第12070号民事裁定书，裁定受理对北京鸿安停车库制造有限公司进行强制清算的申请。并指定毕马威华振会计师事务所担任北京鸿安停车库制造有限公司清算组，现就有关事项公告如下：一、北京鸿安停车库制造有限公司的债权人应自公告之日起45日内向北京鸿安停车库制造有限公司清算组申报债权（通信地址：北京市东城区长安街1号东方广场东二办公楼8层810室，毕马威华振会计师事务所；联系电话：010-85085836、85085853； 联系人：李晓峰），并提交有关证明材料。未在上述期限内申报债权的，可以在清算财产分配完毕前补充申报，但对此前已进行的分配无权要求补充分配，同时要承担为审查和确认补充申报债权所产生的费用。未申报债权的，不得依照法律规定的程序行使权利。二、北京鸿安停车库制造有限公司的债务人或者财产持有人应当向北京鸿安停车库制造有限公司清算组清偿债务或交付财产。', 'http://www.live.chinacourt.org/fygg/display/id/4389858.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('55', '北京爱思靓机床设备有限公司', '北京市通州区人民法院', '2016-01-06', '八版', '申请人北京市燕东祥商贸有限公司申请被申请人北京爱思靓机床设备有限公司进行强制清算一案。经审理，被申请人北京爱思靓机床设备有限公司人员、账册、重要文件下落不明。无法查明其财产状况，已构成无法清算。依据法律规定，裁定终结北京爱思靓机床设备有限公司的强制清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4369456.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('56', '北京龙川环保机械设备有限公司', '北京市通州区人民法院', '2016-01-05', '二版', '2015年4月15日，本院裁定立案受理申请人北京市燕东祥商贸有限公司对被申请人北京龙川环保机械设备有限公司强制清算一案。2015年9月7日，本院指定北京市鑫诺律师事务所成立北京龙川环保机械设备有限公司清算组。债权人应当自接到通知书之日起三十日内，未接到通知书的自公告之日起四十五日内，向清算组（清算组工作地址：北京市西城区宣武门庄胜广场中央办公楼北楼北翼9层，联系人：刘建军，联系电话：83913636-8009）申报其债权。债权人申报债权，应当说明债权的有关事项，并提供证明材料。清算组应当对债权进行登记。在申报债权期间，清算组不得对债权人进行清偿。公司清偿时，债权人对清算组核定的债权有异议的，可以要求清算组重新核定。清算组不予重新核定，或者债权人对重新核定的债权仍有异议，债权人有权以公司为被告向人民法院提起诉讼请求确认。', 'http://www.live.chinacourt.org/fygg/display/id/4369439.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('57', '北京奇力物流有限公司', '北京市顺义区人民法院', '2015-12-24', '二版', '北京格林鑫源纸制品有限公司申请北京奇力物流有限公司强制清算一案。经审查，被申请人北京奇力物流有限公司人员下落不明，无法继续进行清算。根据法律规定，裁定终结北京格林鑫源纸制品有限公司的强制清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4345244.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('58', '北京林云昌盛建筑装饰工程有限公司', '北京市房山区人民法院', '2015-12-24', '二版', '2014年12月15日，本院根据申请人北京东方福霖大型楼板有限公司的申请裁定受理被申请人北京林云昌盛建筑装饰工程有限公司清算纠纷一案，并指定清算组。清算组以无法进行清算程序为由向本院申请终结本案清算程序。本院认为因北京林云昌盛建筑装饰工程有限公司清算所需的财务资料、资产信息不完整，使清算组无法查清该公司资产情况，清算工作无法继续进行，故清算程序应予终结，债权人可另行依法要求该公司的清算义务人对其债务承担偿还责任。故依照法律规定，本院于2015年11月5日裁定终结北京林云昌盛建筑装饰工程有限公司清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4345250.shtml', '2016-06-13 15:43:27');
INSERT INTO `chinacourt_fygg` VALUES ('59', '北京同道光彩影视文化有限公司', '北京市海淀区人民法院', '2015-12-24', '二版', '因已清算完毕，依照《中华人民共和国公司法》一百八十八条之规定，本院于2015年12月8日裁定终结北京同道光彩影视文化有限公司强制清算程序。', 'http://www.live.chinacourt.org/fygg/display/id/4348924.shtml', '2016-06-13 15:43:27');
