INSERT INTO `sys_announcement` VALUES ('1', '22', '北京市密云区人民法院', '2016-06-03', '二版', '北京天泰鑫源商贸有限公司及公司股东：\\n北京市密云区人民法院根据北京金环房地产开发有限公司的申请，于2016年5月25日裁定受理对你单位进行强制清算的申请。因你单位下落不明，本院决定向你单位公告送达本院（2016）京0118民算2号民事裁定书，自公告之日起经过60日即视为送达。并于2016年8月23日上午9时在北京市密云区人民法院第十八法庭召开第一次债权人会议。本案由法官于立华任审判长，与法官王化雨、张俊杰组成合议庭，书记员郑伟担任法庭记录。\\n', 'http://www.live.chinacourt.org/fygg/display/id/4668526.shtml', null, null);
